import { Link, useMatch, useResolvedPath } from "react-router-dom"
import "./navbar.css";

export default function Navbar() {
  return (
    <nav className="nav">
      <Link to="/" className="site-title">
        Price Comparator
      </Link>
      <ul>
        <Link to="/about">About Us</Link>
        <Link to="/contact">Contact</Link>
      </ul>
    </nav>
  )
}
